import Log from "../Log";

const Logssec = () => {
    return ( 
    <>
        <div className="container-logssec">
            <section className="container-log-dia">
                <h3>02 de Agosto</h3>
                <Log
                titulo ="Solução"
                
                />
                <Log/>
                <Log/>
            </section>
        </div>
    </>
     );
}
 
export default Logssec;
